import axios from 'axios'

const baseUrl = "https://www.thecocktaildb.com/api/json/v1/1"

const getAll = () => {
    const request = axios.get(`${baseUrl}/search.php?f=%`)
    return request.then(response => response.data)
  }

  export default {getAll}
